import {
  SlMenuLabel
} from "./chunk.6T673YG6.js";

// src/react/menu-label/index.ts
import * as React from "react";
import { createComponent } from "@lit/react";
var tagName = "sl-menu-label";
SlMenuLabel.define("sl-menu-label");
var reactWrapper = createComponent({
  tagName,
  elementClass: SlMenuLabel,
  react: React,
  events: {},
  displayName: "SlMenuLabel"
});
var menu_label_default = reactWrapper;

export {
  menu_label_default
};
